import React from "react";
import ExerciseList from "./Components/ExerciseList";
import EntryList from "./Components/EntryList";

function CreateEntry(entryitem)
  {
    <ExerciseList
      key = {entryitem.id}
      img = {entryitem.img}
      name = {entryitem.name}
      description = {entryitem.meaning}
    />
  }

function App()
{
  return(<div>
    EntryList.map(CreateEntry);
  </div>);
}

export default App;
